import React from 'react';
import '../css/home.css'
import axios from 'axios';
import { toast } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';
function Home(props) {
    const navigate = useNavigate()
    const user = {
        "deviceId": "42940546-D218-4ABF-958B-FB87AE0FC10A",
        "reason": "",
        "ssid": "FIS-user",
        "ipGateway": "10.15.180.1",
        "type": 0
    }

    const check_in = ()=>{
        generateRandomNumber()
        check_in2()
    }
    
    const check_in2 = async () => {
        var getToken = localStorage.getItem("token")
        const res = await axios.post('https://ddc.fis.vn/fis0/api/checkin_all',user, { headers: { "Authorization": `Bearer ${getToken}` } })
        if (res.data.resultCode == -1) {
            toast.warning(res.data.message)
            navigate('/')
        }
        else (
            toast.success(res.data.message)
        )
    }
   const check_out = () =>{
     generateRandomNumber()
     check_out2()
   }
    const check_out2 = async () => {
        var getToken = localStorage.getItem("token")
        const res = await axios.post('https://ddc.fis.vn/fis0/api/checkout_all',user, { headers: { "Authorization": `Bearer ${getToken}`} })
        if (res.data.resultCode == -1) {
            toast.warning(res.data.message)
            navigate('/')
        }
        else (
            toast.success(res.data.message)
        )
    }
    return (
        <div className='box-check'>
            <div className='d-flex justify-content-between '>
                <button type="button" class="btn btn-info text-white" onClick={() => check_in()}>Chi</button>
                <button type="button" class="btn btn-danger text-white" onClick={() => check_out()}>Chot</button>
            </div>
        </div>
    );
}

export default Home;
